VALUES ('3331480005818', 'Omelette norvégienne au rhum', 'Crème glacée au rhum avec raisins macérés au rhum (64,4 %) : eau, sucre liquide (sucre, eau), _crème_ fraîche pasteurisée, raisins secs macérés au rhum (10 %) (raisins secs, rhum, gélifiant : gomme xanthane), _lactose_ et protéines de _lait_ en poudre, sirop de glucose-fructose de blé, jaunes d\'_œufs_ sucres pasteurisés (jaunes d\'_œufs_, sucre), _lait_ écrémé en poudre, préparation texturante (émulsifiant : mono- et diglycérides d\'acides gras d\'origine végétale, épaississants : gomme guar - farine de graines de caroube, gélifiants : alginate de sodium -  carraghénanes), rhum gélifié (0,5 %) (rhum 50 % volume, épaississant : gomme xanthane). Meringue flambée (24,8 %) : sucre liquide (sucre, eau), blancs d\'_œufs_ sucrés thermisés (blancs d\'_œufs_, sucre), sucre, eau, sirop de glucose-fructose de blé, blancs d\'_œufs_ en poudre, épaississants : gomme guar - gomme xanthane - farine de graines de caroube. Génoise (5,9 %) : _œufs_ pasteurisés, farine de _blé_, sucre, jaunes d\'_œufs_ sucrés pasteurisés (jaunes d\'_œufs_, sucre), stabilisant : sorbitols de blé, eau, émulsifiant : mono- et diglycérides d\'acides gras d\'origine végétale. Sirop au rhum (4,9 %) : eau, sucre liquide (sucre, eau), sirop de glucose-fructose de blé, rhum gélifiant (2,6 %) (rhum 50 % volume, épaississant : gomme xanthane).', 'https://static.openfoodfacts.org/images/products/333/148/000/5818/front.5.400.jpg', '2.1', '1.2', '14.9', '12.5', '0.5', '1.9', '0.04', '0.015748031496063', '', '1');

